import React from "react";
import {
  makeStyles,
  createStyles,
  Theme,
  Container,
  Typography
} from "@material-ui/core";
import { Task } from "../../../types/Task";

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      height: "2000px",
      padding: theme.spacing(3)
    }
  })
);

interface Props {
  task: Task | null;
}

const MainInterface: React.FC<Props> = ({ task }) => {
  const classes = useStyles();

  if (task) {
    if (task.taskDefinitionKey === "SayHello") {
      return (
        <Container maxWidth="md" className={classes.root}>
          <Typography variant="h4">Kein Task ausgewählt</Typography>
          <Typography>Bitte wähle einen Task aus der Liste links.</Typography>
        </Container>
      );
    } else {
      return (
        <Container maxWidth="md" className={classes.root}>
          <Typography variant="h4">Kein Task ausgewählt</Typography>
          <Typography>Bitte wähle einen Task aus der Liste links.</Typography>
        </Container>
      );
    }
  } else {
    return (
      <Container maxWidth="md" className={classes.root}>
        <Typography variant="h4">Kein Task ausgewählt</Typography>
        <Typography>Bitte wähle einen Task aus der Liste links.</Typography>
      </Container>
    );
  }
};

export default MainInterface;
